import React from "react";
import AppBar from '@mui/material/AppBar'
import Toolbar from '@mui/material/Toolbar'
import Typography from '@mui/material/Typography'
import Box from '@mui/material/Box'
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import { Link } from "react-router-dom";
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { blueGrey, green } from '@mui/material/colors';

const theme = createTheme({
  palette: {
    primary: {
      // Purple and green play nicely together.
      main: blueGrey[500],
    },
    secondary: {
      // This is green.A700 as hex.
      main: green[100],
    },
  },
});


const Navegacion = ({brand}) =>{
  

    return( <ThemeProvider theme={theme}>
    
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>

          <img src="C:/Users/d_b_o/Desktop/dev_dan/r_m/src/assets/img/r_ma.png" className='naimg' alt=""/>
         
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            {brand}
          </Typography>
          <Link to = '/'><Button color="secondary">Inicio</Button></Link>
          <Link to = '/personajes' ><Button color="secondary"> Personajes</Button></Link>
        </Toolbar>
      </AppBar>
    
    </Box>
    
    </ThemeProvider>
    )
}
export default Navegacion
